from flask import Flask, render_template
app = Flask(__name__)

@app.route('/post/<int:index>')
def post(index):
    title= [
        "Tôi yêu code",
        "Tôi yêu Ộc",
        "Tôi yêu buffet"
    ]
    content= [
        "Nhưng tôi kb code ntn",
        "Nhưng tôi không biết nói với cô ấy ntn",
        "Nhưng tôi không có tiền"
    ]
    t = title[index]
    c = content[index]
    return render_template("post.html", title=t, content=c)

@app.route('/movies')
def movie():
    movies_list = [
        {
            'title': 'Deadpool',
            'image': "data:image/jpeg;base64,"
        },
        {
            'title': 'Captain America',
            'image': "data:image/jpeg;base64,"
        },
        {
            'title': 'Thor',
            'image': "data:image/jpeg;base64,"
        }

    ]
    return render_template('movie.html', movies=movies_list)
  

if __name__ == '__main__':
  app.run(debug=True)